import React from "react";
import './dashNav.scss'

const DashNav = props => {

    return(
        <div className="dashNav">
            <div className='mNeme'>
                <span className='m'>m</span>
                <span className='neme'>Neme</span>
            </div>
            <i className="fas fa-search"></i>
        </div>
    )
}
export default DashNav;
